import React from 'react';

const Title = () => {
  return (
    <div>
      <div className="title">
        <h1>instaport</h1>
        <h2>Your Pictures</h2>
        <p></p>
      </div>
      <div className="signup">
        <h1>Sign Up</h1>
      </div>
    </div>
  )
}

export default Title;
